import React from 'react'

function Friends(props) {
    return (
        <div className="friendHeader">
            <h1>{props.friend.name}</h1>
            <p>{props.friend.age}</p>
            <p>{props.friend.email}</p>
        </div>
    )
}

export default Friends;
